const draw = data => {
  // data is an array that looks like this
  // [{"row":3,"matchDay":"13 August 2016 (Matchweek 1)","date":"13 Aug","week":"1","teams":[{"team":"AFC Bournemouth","rank":16},{"team":"Manchester United","rank":5}],"teamDiff":231}, ...]
  // dimensions
  // prepare data: group by weeks
  const weekMatches = [];
  _.each(_.groupBy(data, 'week'), (m, w) => {
    let total = m.reduce((total, match) => { return total + match.teamDiff;}, 0);
    weekMatches[w-1] = {
      week: w,
      startDate: m[0].date,
      matches: m,
      teamDiffTotal: total
    }
  });

  // DOM references
  const container = d3.select('#container');
  const chart = d3.select('.chart');

  // color scale
  const color = d3.scale.linear()
    .domain(d3.extent(weekMatches, d => d.teamDiffTotal))
    .range(['#6b1212', '#e5bebe'])
  ;
  const colorFx = d => color(d.teamDiffTotal);

  // update color legend
  d3.selectAll('.heatmap')
    .style('background-image', 'linear-gradient(to right,' +color.range()[0]+ ',' +color.range()[1]+ ')')
  ;

  // font scale
  const font = d3.scale.log()
    .domain(d3.extent(data, d => d.teamDiff))
    .range([20, 8])
  ;
  const fontFx = d => (font(d.teamDiff) + 'px');


  //============== start adding pieces to the page
  // add matchdays
  const mdContainer = chart.selectAll('.matchday').data(weekMatches);

  // matchday container: background + match container
  mdContainer
    .enter()
    .append('div')
      .attr('class', 'matchday')
      .style('height', '25px')
  ;
  // matchday color
  mdContainer.selectAll('.matchday__bg').data(d => [d])
    .enter()
    .append('div')
        .attr('class', 'matchday__bg')
        .style('background-color', colorFx)
        .style('display', 'inline-block')
        .style('height', '100%')
        .style('vertical-align', 'top')
        .style('width', '80px')
        .html(d => '<span style="font-size: 18px; font-weight: 100;float: left; margin-left: 2px;">' + d.week + '.</span> <span style="float:right;margin-top:7px; margin-right: 2px;">' + d.startDate + '</span>')
  ;
  // matches container
  let matches = mdContainer.selectAll('.matchday__matches').data(d => [d]);
  matches
    .enter()
    .append('div')
        .attr('class', 'matchday__matches')
        .style('display', 'inline-block')
        .style('height', '100%')
  ;
  // matches
  let match = matches.selectAll('match').data(d => d.matches.sort( (a, b) => a.teamDiff - b.teamDiff));
  match
    .enter()
    .append('div')
        .attr('class', 'match')
        .style('display', 'inline-block')
        .style('margin-left', '5px')
        .style('line-height', '25px')
        .style('font-size', fontFx)
        .style('font-weight', d => (d.teams[0].rank < 6 || d.teams[1].rank < 6 ? 500 : 200) )
        .attr('title',d => d.teams.map(t => '#'+ t.rank + ' ' +t.team).join(' vs '))
        .text(d => d.teams.map(t => t.abbr).join('-') )
  ;
}

